script: |
  super -f text -I q9333.spq | sort > q9333.out

inputs:
  - name: q9333.spq
    data: |
      SELECT DISTINCT + col0 FROM tab0 (FORMAT parquet) WHERE 72 * + 66 NOT IN ( - - 96, col2 + - ( 5 ), + col0 + - - ( - 26 ), - 96 * + + ( col0 ) / col0, - + col1 );
  - name: tab0

outputs:
  - name: q9333.out
    data: |
      15
      87
      97
